import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      days: 23,
      "hours": 13,
      "minutes": 20,
      "seconds": 34
    };
  }
  render() {
    return (
      <div className="App" >
        <div className="intro-text">
          <p>When is CSN due?</p>
          <hr />
        </div>
        <div className="timer">
          <p> {this.state.days} Days {this.state.hours} Hours {this.state.minutes} Minutes {this.state.seconds} Seconds</p>
        </div>
        <div className="qoute-of-the-day">
          <p className="quote">"People say nothing is impossible, but i do nothing every day"</p>
          <p className="quoter">- Winnie T. Pooh</p>
        </div>
        <div className="link-csn">
          <a href="https://www.csn.se/"> Click here to visit CSNs website</a>
          <div className="jonathan">
            <p>By Jonathan Hedlund <br /> www.jonathanhedlund.com</p>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
